define('db',['Firebase', 'mediator', 'log', 'sha1', 'user'], function (Firebase, mediator, log, sha1, user) {

	

	var db = {

		url: {
			//script: 'https://cdn.firebase.com/js/client/2.2.1/firebase.js',
			dataBase: 'https://radiant-torch-4344.firebaseio.com/messenger/'
		},

		attr: {},

		init: function () {

			var base = this,
				fireBase = new Firebase(base.url.dataBase);

			base.set('db', fireBase);

			log('Firebase init');

			base.bindLeaderBordListener();

		},

		set: function (key, value) {
			this.attr[key] = value;
			return this;
		},

		get: function (key) {
			return this.attr[key];
		},

		bindLeaderBordListener: function () {

			var base = this;

			mediator.installTo(base);

			base.subscribe('register-user', base.registerUser);
			base.subscribe('login-user', base.loginUser);
			base.subscribe('auto-login-user', base.autoLoggingUser);

		},

		registerUser: function (dataArg) {

			var base = this,
				db = base.get('db'),
				data = dataArg || {},
				login = data.login,
				hash = sha1.hash(login + data.password),
				id = sha1.hash(hash);

			data.hash = hash;

			data.id = id;

			// save to main data
			db.child('/users').push(data);

			// save for safe and fast access
			db.child('/usersData').push({
				id: id,
				login: login
			});

			base.publish('auto-login-user', { hash: hash });

			log('try to reg user', data);

		},

		loginUser: function (dataArg) {

			var base = this,
				db = base.get('db'),
				data = dataArg || {},
				hash = sha1.hash(data.login + data.password);

			log('try to login ', data);

			db.child('/users').orderByChild('hash').equalTo(hash).once('value', function (snap) {

				var userData = snap.val(),
					dbHash;

				if (userData) {
					dbHash = _.keys(userData)[0];
					base.publish('login-successful', userData[dbHash]);
					base.set('db-hash', dbHash);
				} else {
					base.publish('login-failed');
				}

			});

		},

		autoLoggingUser: function (dataArg) {

			var base = this,
				db = base.get('db'),
				data = dataArg || {},
				hash = data.hash || '';

			log('try to auto login', hash);

			db.child('/users').orderByChild('hash').equalTo(hash).once('value', function (snap) {

				var userData = snap.val(),
					dbHash;

				if (userData) {
					dbHash = _.keys(userData)[0];
					base.publish('login-successful', userData[dbHash]);
					base.set('db-hash', dbHash);
				} else {
					base.publish('auto-login-failed');
				}

			});

		}

	};

	db.init();

	return db;

});

define('BaseView',['underscore', 'jquery', 'backbone', 'mediator', 'router', 'templateMaster', 'log', 'info'], function (_, $, bb, mediator, router, templateMaster, log, info) {

	

	return bb.View.extend({

		baseEvents: {
			'click [data-route]': 'routeTo',
			'click .js-back': 'routeBack'
		},

		baseSelectors: {
			//wrapper: '.js-wrapper',
			//viewWrapper: '.js-view-wrapper'
		},

		// will be changed after initStatic
		eventTypes: {
			down: ['mousedown', 'touchstart'],
			move: ['mousemove', 'touchmove'],
			up: ['mouseup', 'touchend'],
			dbl: ['dblclick', 'doubletap']
		},

		tmpl: templateMaster.tmplFn,

		info: info,

		constructor: function() {

			var view = this,
				proto = view.constructor.prototype,
				newEvents = {};

			view.events = $.extend( {}, proto.baseEvents, view.events );

			// prepare extra events from eventTypes
			_.each(view.events, function (functionName,  eventAndSelector) {
				newEvents[view.getFullEventNameAndSelector(eventAndSelector)] = functionName;
			});

			view.events = newEvents;

			view.selectors = $.extend( {}, proto.baseSelectors, view.selectors );

			mediator.installTo(view);

			view.subscribe('hide', view.hide);

			//view.attr = {};

			//view.setClassNames();

			//view.proto = proto;

			return bb.View.prototype.constructor.apply(view, arguments);

		},

		getFullEventNameAndSelector: function (eventNameAndSelector) {

			var view = this,
				arr = eventNameAndSelector.split(' '),
				newEventName = view.eventTypes[arr[0]];

			if (newEventName) {
				return [newEventName, arr[1]].join(' ');
			}

			return eventNameAndSelector;

		},

		routeTo: function (e) {

			var $this = $(e.currentTarget),
				route = $this.attr('data-route');

			router.navigate(route, true);

		},

		routeBack: function () {

			if (window.location.hash) {
				bb.history.history.back();
			}

		},

		render: function () {

			var view = this;

			$('.js-wrapper').append(view.$el);

			view.publish('hide', {except: [this]});

			return view.showAppearAnimation();

		},

		showAppearAnimation: function () {

			var view = this,
				info = view.info,
				isScreenAnimation = info.get('screenAnimation') === 'on',
				$el = view.$el,
				deferred = $.Deferred(),
				animationEnd = info.get('animationEnd', true);

			if (isScreenAnimation) {
				$el.one(animationEnd, function () {
					deferred.resolve();
				});
				$el.addClass('show-view-animation');
			} else {
				$el.addClass('show-view-no-animation');
				deferred.resolve();
			}

			return deferred.promise();

		},

		hide: function (dataArg) {

			var view = this,
				data = dataArg || {},
				info = view.info,
				$el = view.$el,
				animationEnd = info.get('animationEnd', true),
				isScreenAnimation = info.get('screenAnimation') === 'on',
				deferred = $.Deferred();

			if ( _.contains(data.except, view) ) {
				log('excepted view -',  view);
				return;
			}

			if (view.unbindEventListeners) {
				view.unbindEventListeners();
			}

			if (isScreenAnimation && $el.hasClass('show-view-animation')) {
				$el.one(animationEnd, function () {
					view.destroyView();
					deferred.resolve();
				});
				//$el.removeClass('show-view-animation');
				$el.addClass('hide-view-animation');
			} else {
				view.destroyView();
				deferred.resolve();
			}

			return deferred.promise();

		},

		destroyView: function() {

			var view = this;

			view.undelegateEvents();

			view.$el.removeData().unbind().remove().empty();

			view.remove();
			view.unbind();

			view.unsubscribe();

			return bb.View.prototype.remove.call(view);

		},

		initStatic: function () {

			var proto = this,
				info = proto.info,
				isTouch = info.get('isTouch', true),
				eventTypesIndex = Number(isTouch),
				types = proto.eventTypes;

			proto.$wrapper = $('.js-wrapper');

			_.each(types, function (typesArr, key) {
				types[key] = typesArr[eventTypesIndex];
			});

			$(window.document.body).on('contextmenu', proto.stopEvent);

		},

		stopEvent: function (e) {

			if (!e) {
				return;
			}

			e.preventDefault();
			e.stopPropagation();

		}
		//,
		//showPopup: function(data) {
		//	var view = this,
		//		showDeferred = $.Deferred(),
		//		hideDeferred = $.Deferred(),
		//		popup,
		//		PopupView;
		//
		//	//view.hidePopup();
		//
		//	popup =	new PopupView(data);
		//	popup.showDeferred = showDeferred;
		//	popup.hideDeferred = hideDeferred;
		//
		//	return popup;
		//
		//}

	});

});
define('PopupView',['jquery', 'backbone', 'log', 'BaseView'], function ($, bb, log, BaseView) {

	

	return BaseView.extend({

		events: {
			'click .js-popup-container': 'stopEvent'
		},

		selectors: {
			popupContainer: '.js-popup-container'
		},

		//tmpl: templateMaster.tmplFn,
		//
		//info: info,

		initialize: function(dataArg) { // timeout, cssClass, from, data {text, header ...}, append$el, sound, onShow {context, fn}, onHide {context, fn}

			//router.routeToPopup();

			var view = this,
				data = dataArg || {},
				onShowDeferred = $.Deferred(),
				onHideDeferred = $.Deferred(),
				onShowPromise = onShowDeferred.promise(),
				onHidePromise = onHideDeferred.promise();

			view.publish('router-route-to-popup');

			view.unsubscribe();
			view.subscribe('hide-popup', view.hide);

			view.data = {
				name: data.name, // name of template for content
				cssClass: data.cssClass || '',
				content: data.content || {},
				timeout: data.timeout || 0,

				sound: data.sound || null, // optional - path to media file
				onShow: data.onShow || null, // optional {context: [context || view], fn: <function>, args: [args || optional]}
				onHide: data.onHide || null, // optional {context: [context || view], fn: <function>, args: [args || optional]}

				onShowDeferred: onShowDeferred,
				onHideDeferred: onHideDeferred,
				onShowPromise: onShowPromise,
				onHidePromise: onHidePromise,

				timeoutId: null // self set

			};

			view.$el = $(view.tmpl['popup-wrapper']());

			view.$el.addClass(view.data.cssClass);

			//view.proto.initialize.apply(this, arguments);

			view.render();

			view.showInAnimation();

			view.bindEventListeners();

		},

		bindEventListeners: function () {

			var view = this,
				timeout = view.data.timeout;

			if (timeout) {
				view.data.timeoutId = setTimeout(function () {
					view.publish('router-hide-popup');
				}, timeout);
			}

		},

		unbindEventListeners: function () {

			var view = this;

			if ( view.data.timeout ) {
				clearTimeout(view.data.timeoutId);
			}

		},

		render: function () {

			var view = this,
				data = view.data,
				sound = data.sound,
				$content = $(view.tmpl[data.name](data.content)),
				$container = view.$el.find(view.selectors.popupContainer),
				onShow = data.onShow,
				context;

			if (sound) {
				log('sound -', sound);
				//win.APP.soundMaster.play(sound);
			}

			$container.append($content);

			view.$wrapper.append(view.$el);

			if (onShow) {
				context = onShow.context || view;
				context[onShow.fn].apply(context, onShow.args);
			}

		},

		hide: function () {

			var view = this;

			view.unsubscribe();

			view.showOutAnimation().then(function () {

				var data = view.data,
					onHide = data.onHide,
					context;

				data.onShowDeferred.resolve();

				if (onHide) {
					context = onHide.context || view;
					context[onHide.fn].apply(context, onHide.args);
				}

				data.onHideDeferred.resolve();

				BaseView.prototype.hide.call(view);

			});

		},

		// actions
		showInAnimation: function () {

			var view = this,
				$el = view.$el,
				$container = $el.find(view.selectors.popupContainer),
				deferred = $.Deferred(),
				animationEnd = view.info.get('animationEnd', true);

			$container.one(animationEnd, function () {
				view.data.onShowDeferred.resolve();
				deferred.resolve();
			}); // work only one time

			$container.addClass('popup-container-show-in');

			return deferred.promise();

		},

		showOutAnimation: function () {

			var view = this,
				$el = view.$el,
				$container = $el.find(view.selectors.popupContainer),
				deferred = $.Deferred(),
				animationEnd = view.info.get('animationEnd', true);

			$container.one(animationEnd, function () {
				deferred.resolve();
			}); // work only one time

			$container.addClass('popup-container-show-out');

			return deferred.promise();

		}


	});

});
